import { Component } from '@angular/core';
import { ApiService } from '../../services/api-service.service';
import { ProfileComponent } from '../profile/profile.component';
import { ProfilebannerComponent } from '../profile/profilebanner/profilebanner.component';

@Component({
  selector: 'app-user',
  templateUrl: './user.component.html',
  styleUrls: ['./user.component.css']
})
export class UserComponent {

  constructor(private profile: ProfileComponent, private banner: ProfilebannerComponent, private api:) { }

  ngOnInit() {
    this.profile.ngOnInit();
    this.banner.ngOnInit();
  }
}
